import React from "react";

export default function ProjectList({ projects }) {
  console.log(projects);
  return (
    <div>
        {projects.map(({ projectName, projectStatus }, index) => {
          return (
            <div key={index} style = {{ margin:'10px'}}>
              <h3>{projectName}</h3>
              <h4>{projectStatus}</h4>
            </div>
          );
        })}
    </div>
  );
}
